export const FakeAPI = () => {
    login: async ({email, password}) => {
        return Promise((resolve) => {
            setTimeout(() => {
                if(email === 'test@gmail.com' && password === '1234') {
                    resolve({success: true, user: {name: 'Admin'}})
                } else {
                    resolve({success: false, message: 'invalid credentials'})
                }
            }, 1000)
        })
    }
}
